#include <iostream>
#include <vector>
#include <algorithm>
using namespace std;

// æ£€æŸ¥4å¼ ç‰Œä¸­æ˜¯å¦èƒ½æ‰¾åˆ°ä¸¤ä¸ªä¸ç›¸äº¤çš„é›†åˆï¼Œå®ƒä»¬çš„ç‚¹æ•°å’Œç›¸ç­‰
// è¿”å› {å–å‡ºçš„ç‰Œæ•°, ç‚¹æ•°æ€»å’Œ}
pair<int, int> findBestSolution(vector<int>& cards) {
    int maxCards = 0;
    int maxSum = 0;
    
    // æšä¸¾æ‰€æœ‰å¯èƒ½çš„å­é›†ç»„åˆ
    for (int mask1 = 1; mask1 < 16; mask1++) {  // ä»1åˆ°15ï¼Œè¡¨ç¤ºéç©ºå­é›†
        for (int mask2 = 1; mask2 < 16; mask2++) {
            // ä¸¤ä¸ªé›†åˆä¸èƒ½æœ‰é‡å 
            if (mask1 & mask2) continue;
            
            int sum1 = 0, sum2 = 0;
            int cnt1 = 0, cnt2 = 0;
            
            // è®¡ç®—ç¬¬ä¸€ä¸ªé›†åˆçš„ç‚¹æ•°å’Œ
            for (int i = 0; i < 4; i++) {
                if (mask1 & (1 << i)) {
                    sum1 += cards[i];
                    cnt1++;
                }
            }
            
            // è®¡ç®—ç¬¬äºŒä¸ªé›†åˆçš„ç‚¹æ•°å’Œ
            for (int i = 0; i < 4; i++) {
                if (mask2 & (1 << i)) {
                    sum2 += cards[i];
                    cnt2++;
                }
            }
            
            // æ£€æŸ¥ç‚¹æ•°å’Œæ˜¯å¦ç›¸ç­‰
            if (sum1 == sum2) {
                int totalCards = cnt1 + cnt2;
                int totalSum = sum1 + sum2;  // æˆ–è€… sum1 * 2
                
                // ä¼˜å…ˆé€‰æ‹©ç‰Œæ•°å¤šçš„æ–¹æ¡ˆ
                if (totalCards > maxCards) {
                    maxCards = totalCards;
                    maxSum = totalSum;
                }
                // ç‰Œæ•°ç›¸åŒæ—¶é€‰æ‹©ç‚¹æ•°æ€»å’Œå¤§çš„æ–¹æ¡ˆ
                else if (totalCards == maxCards && totalSum > maxSum) {
                    maxSum = totalSum;
                }
            }
        }
    }
    
    return {maxCards, maxSum};
}

int main() {
    int n;
    cin >> n;
    
    vector<int> deck(n);
    for (int i = 0; i < n; i++) {
        cin >> deck[i];
    }
    
    // åè½¬ç‰Œå †ï¼Œä½¿å…¶ä»æ ˆé¡¶åˆ°æ ˆåº•ï¼ˆä¾¿äºæ“ä½œï¼‰
    reverse(deck.begin(), deck.end());
    
    int totalRemoved = 0;
    
    while (deck.size() >= 4) {
        // å–å‡ºæ ˆé¡¶çš„4å¼ ç‰Œ
        vector<int> currentCards;
        for (int i = 0; i < 4; i++) {
            currentCards.push_back(deck.back());
            deck.pop_back();
        }
        
        // å¯»æ‰¾æœ€ä½³è§£å†³æ–¹æ¡ˆ
        auto result = findBestSolution(currentCards);
        int cardsToRemove = result.first;
        
        // å¦‚æœæ²¡æœ‰æ‰¾åˆ°è§£å†³æ–¹æ¡ˆï¼Œæ¸¸æˆç»“æŸ
        if (cardsToRemove == 0) {
            break;
        }
        
        totalRemoved += cardsToRemove;
        
        // æ ‡è®°è¦ç§»é™¤çš„ç‰Œ
        vector<bool> removed(4, false);
        int bestMask1 = 0, bestMask2 = 0;
        int bestCards = 0, bestSum = 0;
        
        // é‡æ–°å¯»æ‰¾æœ€ä½³ç»„åˆæ¥æ ‡è®°è¦ç§»é™¤çš„ç‰Œ
        for (int mask1 = 1; mask1 < 16; mask1++) {
            for (int mask2 = 1; mask2 < 16; mask2++) {
                if (mask1 & mask2) continue;
                
                int sum1 = 0, sum2 = 0;
                int cnt1 = 0, cnt2 = 0;
                
                for (int i = 0; i < 4; i++) {
                    if (mask1 & (1 << i)) {
                        sum1 += currentCards[i];
                        cnt1++;
                    }
                    if (mask2 & (1 << i)) {
                        sum2 += currentCards[i];
                        cnt2++;
                    }
                }
                
                if (sum1 == sum2) {
                    int totalCards = cnt1 + cnt2;
                    int totalSum = sum1 + sum2;
                    
                    if (totalCards > bestCards || 
                        (totalCards == bestCards && totalSum > bestSum)) {
                        bestCards = totalCards;
                        bestSum = totalSum;
                        bestMask1 = mask1;
                        bestMask2 = mask2;
                    }
                }
            }
        }
        
        // æ ‡è®°è¦ç§»é™¤çš„ç‰Œ
        for (int i = 0; i < 4; i++) {
            if ((bestMask1 & (1 << i)) || (bestMask2 & (1 << i))) {
                removed[i] = true;
            }
        }
        
        // å°†æœªç§»é™¤çš„ç‰ŒæŒ‰åŸé¡ºåºæ”¾å›ç‰Œå †ï¼ˆä»åå¾€å‰æ”¾å›ï¼‰
        for (int i = 3; i >= 0; i--) {
            if (!removed[i]) {
                deck.push_back(currentCards[i]);
            }
        }
    }
    
    cout << totalRemoved << endl;
    
    return 0;
}

