            Wake_VÑÑ1_On_config(); //Ğ½Ğ°ÑÑ‚Ñ€Ğ¾Ğ¹ĞºĞ° Wake5 Ğ½Ğ° ÑĞ¾Ğ±Ñ‹Ñ‚Ğ¸Ğµ "VBAT < VCC1" Ğ¿Ñ€Ğ¸ Ğ²ĞºĞ»ÑÑ‡ĞµĞ½Ğ¸Ğ¸ VCC1,
                                   //ĞºĞ¾Ñ‚Ğ¾Ñ€Ğ¾Ğµ Ğ¿Ñ€Ğ¾Ğ¸Ğ·Ğ¾Ğ¹Ğ´ĞµÑ‚ Ğ² ÑĞ»ÑƒÑ‡Ğ°Ğµ Ğ²ĞºĞ»ÑÑ‡ĞµĞ½Ğ¸Ñ Ğ¿Ğ¸Ñ‚Ğ°Ğ½Ğ¸Ñ
            // ĞÑ‚ĞºĞ»ÑÑ‡Ğ°ĞµĞ¼ Ğ»Ğ¸ÑˆĞ½Ğ¸Ğµ Ñ„ÑƒĞ½ĞºÑ†Ğ¸Ğ¸ Ğ´Ğ»Ñ Ğ¼Ğ¸Ğ½Ğ¸Ğ¼Ğ°Ğ»ÑŒĞ½Ğ¾Ğ³Ğ¾ Ñ‚Ğ¾ĞºĞ°
            PMURTC->PMU_VBATPER_WFI = 0xFFFFFFFF;
            PMURTC->RTC_REG[1].RTC_REG++;
            PMURTC->RTC_CFG1_bit.ALARMEN = 0;
